const isDevelopment = process.env.NODE_ENV === 'development';
const DEV_API_URL = 'http://localhost:3000';
const PROD_API_URL = process.env.REACT_APP_API_URL || 'http://localhost:3000';

export const API_URL = isDevelopment ? DEV_API_URL : PROD_API_URL;
export const UPLOAD_URL = `${API_URL}/uploads`;
export const PROFILE_PICTURES_URL = `${API_URL}/profile_pictures`;

export const API_ENDPOINTS = {
    LOGIN: '/auth/login',
    PROFILE: '/profile',
    PROFILE_PICTURE: '/profile_picture',
    GALLERY: '/gallery',
    IMAGES: '/images'
};
